    return (
        <div className="upload-section">
            {/* <input type="file" accept="image/*" /> */}
            <img className="upload-image" src={imageLogo} alt="logo image" />
            <h6 className="upload-text">Upload Profile Photo</h6>
            
            
        </div>
    )
}

export default UploadImage
